def generate_distinct_colors(start_key, original_colors):
    distinct_colors = []
    
    while start_key < 245:
        if start_key not in original_colors:
            # Generate a distinct random RGB color
            while True:
                color = (randint(0, 255), randint(0, 255), randint(0, 255))
                if color not in original_colors.values():
                    distinct_colors.append((start_key, color))
                    original_colors[start_key] = color
                    break
        
        start_key += 1

    return distinct_colors

